using System;\nusing System.Diagnostics;\n\nclass Program\n{\n    static void Main()\n    {\n        string[] supportedProcesses = { "process1.exe", "process2.exe", "process3.exe" };\n\n        foreach (string processName in supportedProcesses)\n        {\n            ProcessStartInfo psi = new ProcessStartInfo("tasklist", $"/FI \"IMAGENAME eq {processName}\"")\n            {\n                RedirectStandardOutput = true,\n                UseShellExecute = false,\n                CreateNoWindow = true\n            };\n\n            Process process = Process.Start(psi);\n            string output = process.StandardOutput.ReadToEnd();\n            process.WaitForExit();\n\n            if (output.Contains(processName))\n            {\n                Console.WriteLine($"Supported process running: {processName}");\n            }\n        }\n    }\n}